A primeira App que liga profissionais e empresas em tempo real num processo automatizado e totalmente integrado.

De missões pontuais a projetos de maior duração a experiência merytu permite uma parceria perfeita entre profissionais e empresas, acabando com burocracias e complicações. Matching, pagamento e faturação automáticos, apólices de seguro pop-up, ratings de performance, entre inúmeras inovações que vêm revolucionar o mundo do trabalho.


PROFISSIONAIS

Mais do que uma simples App, o merytu é um movimento. Chegámos para revolucionar o mundo do trabalho e reconhecer o merytu de quem o tem. Faz já o download da App e experimenta um estilo de vida inédito em que a tua carreira é feita na primeira pessoa. Escolhe os Gigs que queres, nos horários que te dão mais jeito e nas empresas que mais te inspiram.
Dá o teu melhor e evolui de nível através dos ratings que recebes. Ao fazê-lo, o teu valor/hora sobe contigo. E sim, é ótimo receber de imediato quando acabas cada Gig.

merytu be proud of yourself



